import "./Footer.css";
function Footer(){
    return(
        <div class="footer">
            <div class="ser">
                <h3>Our Services</h3>
            </div>
            <div class="priv">
                <h3>Privacy Policy</h3>
            </div>
            <div class="con">
                <h3>Contact Us</h3>
                <p>Developer Contact</p>
                <p>Panipat Institute of</p>
                <p>Engineering and Technology</p>
                <p>Samalkha ,132101, Haryana</p>
            </div>

        </div>
    )
}
export default Footer;
